<!DOCTYPE html>
<html lang="tr">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Assemcorp | Depo Yönetim Sistemi</title>
    <script src="https://cdn.jsdelivr.net/npm/jsbarcode@3.11.5/dist/JsBarcode.all.min.js"></script>
    <style>
        :root {
            --primary-color: #2c3e50;
            --accent-color: #3498db;
            --bg-color: #f4f7f6;
        }

        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            background-color: var(--bg-color);
            margin: 0;
            display: flex;
            flex-direction: column;
            align-items: center;
        }

        header {
            background-color: var(--primary-color);
            color: white;
            width: 100%;
            padding: 1rem 0;
            text-align: center;
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
        }

        .container {
            max-width: 800px;
            width: 90%;
            margin-top: 30px;
            background: white;
            padding: 25px;
            border-radius: 12px;
            box-shadow: 0 4px 15px rgba(0, 0, 0, 0.05);
        }

        .input-group {
            display: flex;
            gap: 10px;
            margin-bottom: 20px;
        }

        input {
            flex: 1;
            padding: 12px;
            border: 2px solid #ddd;
            border-radius: 6px;
            font-size: 16px;
            outline: none;
            transition: border-color 0.3s;
        }

        input:focus {
            border-color: var(--accent-color);
        }

        button {
            padding: 12px 25px;
            background-color: var(--accent-color);
            color: white;
            border: none;
            border-radius: 6px;
            cursor: pointer;
            font-weight: bold;
            transition: background 0.3s;
        }

        button:hover {
            background-color: #2980b9;
        }

        #barcode-container {
            display: flex;
            flex-direction: column;
            align-items: center;
            margin-top: 30px;
            padding: 20px;
            border: 1px dashed #ccc;
            border-radius: 8px;
            min-height: 200px;
            justify-content: center;
        }

        canvas {
            max-width: 100%;
        }

        .actions {
            margin-top: 20px;
            display: none;
            /* Barkod oluşmadan görünmez */
            gap: 10px;
        }

        .print-btn {
            background-color: #27ae60;
        }

        /* Yazdırma Ayarları */
        @media print {
            body {
                background-color: white;
            }

            /* Her şeyi gizle */
            header,
            .input-group,
            #controls-area,
            .version-tag {
                display: none !important;
            }

            .container {
                box-shadow: none;
                margin: 0;
                padding: 0;
                width: 100%;
                max-width: 100%;
            }

            /* Sadece gridi göster */
            #barcode-grid {
                display: block;
                /* Flex yerine block */
            }

            .barcode-item {
                display: inline-block;
                margin: 10px;
                border: none;
                page-break-inside: avoid;
                break-inside: avoid;
            }

            /* Yazdırma sırasında indir butonlarını gizle */
            .barcode-item button {
                display: none;
            }
        }

        .version-tag {
            position: absolute;
            top: 10px;
            right: 15px;
            color: white;
            font-size: 14px;
            font-weight: bold;
            opacity: 0.8;
        }

        #barcode-grid {
            display: flex;
            flex-wrap: wrap;
            gap: 20px;
            justify-content: center;
            width: 100%;
        }

        .barcode-item {
            display: flex;
            flex-direction: column;
            align-items: center;
            margin-bottom: 20px;
            border: 1px solid #ddd;
            padding: 10px;
            border-radius: 8px;
            background: #fff;
            page-break-inside: avoid;
            /* Yazıcıda bölünmesin */
            break-inside: avoid;
        }

        @media print {
            #barcode-grid {
                display: block;
                /* Yazıcıda blok davranışı */
            }

            .barcode-item {
                display: inline-block;
                /* Yan yana sığsın */
                margin: 10px;
                border: none;
                /* Yazıcıda çerçeve olmasın */
            }

            /* Yazıcıda butonları gizle */
            .barcode-item button {
                display: none !important;
            }
        }
    </style>
</head>

                    <!-- Çoklu indirme karmaşık olabileceği için şimdilik gizli veya tekli çalışır -->
                    <!-- <button onclick="downloadImg()">Resim Olarak İndir</button> -->
                </div>
            </div>

            <!-- Barkodların Listelendiği Alan -->
            <div id="barcode-grid">
                <!-- Canvaslar buraya eklenecek -->
            </div>
        </div>

        <script>
            function generate() {
                const val = document.getElementById('rackInput').value.trim();
                const grid = document.getElementById('barcode-grid');
                const placeholder = document.getElementById('placeholder-text');
                const actions = document.getElementById('actionButtons');

                if (!val) {
                    alert("Lütfen bir raf numarası veya aralığı (Örn: A1-A20) girin!");
                    return;
                }

                // Temizle
                grid.innerHTML = '';
                placeholder.style.display = 'none';
                actions.style.display = 'none';

                // Girdiyi işle
                const codes = parseInput(val);

                if (codes.length === 0) {
                    alert("Geçerli bir aralık bulunamadı!");
                    return;
                }

                codes.forEach(code => {
                    // Wrapper
                    const wrapper = document.createElement('div');
                    wrapper.className = 'barcode-item';

                    // Canvas
                    const canvas = document.createElement('canvas');
                    wrapper.appendChild(canvas);

                    // İndirme Butonu
                    const dwnBtn = document.createElement('button');
                    dwnBtn.innerText = 'İndir';
                    dwnBtn.style.marginTop = '10px';
                    dwnBtn.style.padding = '5px 15px';
                    dwnBtn.style.fontSize = '14px';
                    dwnBtn.style.cursor = 'pointer';
                    dwnBtn.onclick = function () {
                        const link = document.createElement('a');
                        const safeName = code.replace(/[^a-z0-9]/gi, '_');
                        link.download = `Assemcorp_Raf_${safeName}.png`;
                        link.href = canvas.toDataURL("image/png");
                        link.click();
                    };
                    wrapper.appendChild(dwnBtn);

                    grid.appendChild(wrapper);

                    // Çiz
                    if (typeof drawBarcode === 'function') {
                        drawBarcode(canvas, code);
                    }
                });

                if (codes.length > 0) {
                    actions.style.display = 'block';
                }
            }

            function parseInput(input) {
                // Aralık kontrolü: A1-A20 veya Raf1-Raf20
                const rangeRegex = /^([^\d]+)(\d+)\s*-\s*([^\d]*)(\d+)$/;
                const match = input.match(rangeRegex);

                if (match) {
                    const prefix = match[1];
                    const startStr = match[2];
                    let endPrefix = match[3];
                    const endStr = match[4];

                    const start = parseInt(startStr, 10);
                    const end = parseInt(endStr, 10);

                    // Eğer ikinci kısımda prefix yoksa, birincisini kullan (A1-20 -> A1-A20)
                    if (!endPrefix) endPrefix = prefix;

                    // Farklı prefix varsa tekli kabul et veya hata ver. Şimdilik aralık için aynı prefix şartı koyalım.
                    // A1-B5 çok mantıklı değil. A1-A20 mantıklı.
                    if (prefix.trim().toLowerCase() !== endPrefix.trim().toLowerCase()) {
                        return [input];
                    }

                    const results = [];
                    // Artan veya azalan
                    if (start <= end) {
                        for (let i = start; i <= end; i++) {
                            results.push(prefix + i);
                        }
                    } else {
                        for (let i = start; i >= end; i--) {
                            results.push(prefix + i);
                        }
                    }
                    return results;
                }

                // Tekli değer
                return [input];
            }

            function drawBarcode(canvas, val) {
                const logoImg = document.getElementById('logo-source');

                // 1. Barkodu Geçici Canvas'a Oluştur
                const tempCanvas = document.createElement('canvas');
                try {
                    JsBarcode(tempCanvas, val, {
                        format: "CODE128",
                        lineColor: "#000",
                        width: 3,
                        height: 100,
                        displayValue: false,
                        margin: 0
                    });
                } catch (e) {
                    console.error(e);
                    return; // Hata varsa çizme
                }

                // 2. Boyutlandırma
                const fontSize = 75;
                const font = "bold " + fontSize + "px 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif";
                const gap = 5; // Boşluk
                const padding = 20;

                // Logo
                let logoW = logoImg.naturalWidth || 0;
                let logoH = logoImg.naturalHeight || 0;
                const targetLogoHeight = 70;
                if (logoH > 0 && logoW > 0) {
                    const logoRatio = logoW / logoH;
                    logoW = targetLogoHeight * logoRatio;
                    logoH = targetLogoHeight;
                } else {
                    logoW = 0; logoH = 0;
                }

                // Metin Genişliği
                const ctx = canvas.getContext('2d');
                ctx.font = font;
                const textMetrics = ctx.measureText(val);
                const textW = textMetrics.width;

                // Toplam Boyut
                const barcodeW = tempCanvas.width;
                const maxContentW = Math.max(barcodeW, logoW, textW);
                const totalW = maxContentW + (padding * 2);

                let totalH = padding + 100 + gap + fontSize + padding;
                if (logoH > 0) totalH += logoH + gap;

                canvas.width = totalW;
                canvas.height = totalH;

                // Arkaplan Beyaz
                ctx.fillStyle = "#FFFFFF";
                ctx.fillRect(0, 0, totalW, totalH);

                // Çizim
                // A. Barkod
                const bcX = (totalW - barcodeW) / 2;
                ctx.drawImage(tempCanvas, bcX, padding);

                let currentY = padding + 100 + gap;

                // B. Logo
                if (logoH > 0) {
                    const lgX = (totalW - logoW) / 2;
                    ctx.drawImage(logoImg, lgX, currentY, logoW, logoH);
                    currentY += logoH + gap;
                }

                // C. Raf Numarası
                ctx.fillStyle = "#000";
                ctx.font = font;
                ctx.textAlign = "center";
                const txtY = currentY + fontSize * 0.75;
                ctx.fillText(val, totalW / 2, txtY);
            }

            function handleKeyPress(e) {
                if (e.key === 'Enter') generate();
            }
            // downloadImg fonksiyonu çoklu seçimde karmaşık olduğu için kaldırıldı veya güncellenebilir.
            // Şimdilik sadece yazdırma aktif.    }
        </script>

</body>

</html>
